import React from "react";
import { HomePage } from "./home";
import './about.css';
import aboutpageimage from './Images/aboutpageimage.webp';

export function AboutMe(){
    return (
        <>
            <HomePage/>
            <h1 className="aboutpageheader mt-3 mb-3 text-center">ABOUT ME</h1>
            <div className="container-fluid row justify-content-around aboutpagediv">
                <div className="col-lg-5">
                    <img src={aboutpageimage} alt="no images found" width="650"/>
                </div>
                <div className="col-lg-5">
                    <h3 className="text-center mt-5 aboutpagecontent ml-auto mr-auto mb-auto mt-auto"> Hello, I am Samuvel Ananth. I am Certified Full Stack Developer. I can create a responsive website. And I can handle the both front end and back end as well alone. Comparitively other languages I have more known about HTML, CSS, JavaScript, Java, Spring Boot, ReactJS amd NodeJS</h3>
                </div>
            </div>
        </>
    );
}
